import React from 'react';
import TaskItem from './TaskItem'; // Importamos el componente TaskItem
import "./ListStyle.css";

const TaskList = ({ tasks, onToggle, onDelete }) => (
  <ul>
    {tasks.map((task) => (
      <TaskItem
        key={task.id}
        task={task}
        onToggle={onToggle} // Funci贸n para marcar como completada
        onDelete={onDelete} // Funci贸n para eliminar tarea
      />
    ))}
  </ul>
);

export default TaskList;
